import React from 'react'
import styled from "styled-components";
function Chat() {
    return (
        <ChatContainer>
            <h1>chat</h1>
            <Header>
                <HeaderLeft>
                    
                </HeaderLeft>
            </Header>
            <h1>chat</h1>
            <h1>chat</h1><h1>chat</h1>
        </ChatContainer>
    )
}

export default Chat

const ChatContainer=styled.div`
    margin-top:50px;
    flex-direction:0.7;
    flex-grow:1;

    overflow-y:scroll;
   
    
    `;
